import React, { useEffect, useState } from 'react';
import Link from 'next/link';
import {Button} from 'antd';
const Home = () => {
    const [count, setCount] = useState(0);
    return (
        <>你好啊洗吧<br />
            {count}
            <Button onClick={() => setCount(count + 1)}>加1</Button>
            <Link href='/user'>
                <a>去user</a>
            </Link>
        </>
    )

};
export default Home;
